import Head from "next/head";
import Navbar from "./Navbar";
import Container from "./Container";

const Layout = (props) => (
  <div>
    <Head>
      <title>Demo App</title>
    </Head>
    <Container maxWidth="sm">
      <Navbar />
    </Container>
    <div className="container">{props.children}</div>
  </div>
);

export default Layout;
